import React from "react";

function Profile() {
  return (
    <div class="card">
      <img src="img.jpg" alt="John" style={{ width: "100%" }} />
      <h1>John Doe</h1>
      <p class="title">CEO & Founder, Example</p>
      <p>Harvard University</p>
      <button>My builds</button>
    </div>
  );
}

export default Profile;
